import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const UserComplaints = () => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const getUserComplaints = async () => {
      // TODO: Giriş yapan kullanıcının ID'sini alın
      const userId = 1; // Örnek olarak 1 olarak varsayalım
      try {
        const response = await axios.get(`http://localhost:5000/user/${userId}/complaints`);
        setComplaints(response.data.complaints);
      } catch (error) {
        console.error(error);
      }
    };
    getUserComplaints();
  }, []);

  return (
    <div>
      <h1>Kullanıcı Arızaları</h1>
      <table>
        <thead>
          <tr>
            <th>Arıza No</th>
            <th>Başlık</th>
            <th>Statü</th>
            <th>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint.id}>
              <td>{complaint.id}</td>
              <td>{complaint.title}</td>
              <td>{complaint.status}</td>
              <td>
                <Link to={`/complaint/${complaint.id}`}>Detayları Gör</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserComplaints;
